⠀
En una breve conferencia de prensa después del pesaje del #UFCVegas9, el "boss" Dana White, dijo que planean  que Chimaev pelee en Las Vegas antes del regreso a la "Fight Island" en Abu Dhabi.⠀
⠀
"Creo que llega aquí este fin de semana", dijo White. "... Él peleará aquí (Las Vegas) y peleará en 'Fight Island'. Este tipo quiere pelear. Me encanta esa mentalidad ".⠀
⠀
En cuanto a los posibles oponentes para las dos peleas, White no ofreció detalles sobre el rival de Chimaev en Las Vegas. Pero un ex retador al título de peso welter de UFC podría ser el oponente de Chimaev en "Fight Island".⠀
⠀
"Estamos trabajando en una pelea para Chimaev en Las Vegas que aún está en proceso", dijo White. "Estamos hablando de él y Demian Maia en Abu Dhabi".⠀
⠀
Chimaev, de 26 años, hizo su debut promocional el 15 de julio, derrotando a John Phillips de manera dominante. Diez días después, Chimaev obtuvo su segunda victoria promocional, terminando a Rhys McKee en el primer round.⠀
⠀
Chimaev se convirtió en el primer peleador en la era moderna de UFC en ganar dos peleas en 10 días.⠀
⠀
Maia viene de caer derrotado ante Gilbert Burns y es una completa leyenda de las artes marciales mixtas.⠀
